import { Container } from 'react-bootstrap';

function ImgContainer(props) {
    return (
        <Container>
            <div className='d-flex flex-wrap justify-content-center box-container' id="img_container">
                {props.usedIds.map(index => {
                    <div className='box'>
                        <a href={props.getSrc(index,'original')} target='_blank'>
                            <img className='img-fluid' alt='random image' src={props.getSrc(index,'medium')} ></img>
                        </a>
                    </div>
                })}
            </div>
        </Container>
    );
};

export default ImgContainer;

